The Request and Response objects are simple structs with added user-defined Solidity methods. These structs are very simple and have the following definitions: struct Header { string key; string value;
} struct Request { string method; string uri; Header[] headers; bytes body;
} struct Response { uint16 status; Header[] headers; bytes body;
} In addition, they each have a method to help read/write headers.

23.body:
Let's assume the request contains the following JSON body: { "user": { "address": "0x61880628e88b391C0161225887D65087EF5bD19B", "ens": "dog.eth" }, "tokens": [ "0xA0b86991c6218b36c1d19D4a2e9Eb0cE3606eB48", "0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2" ]
} We could read the values like so: import 'forgery-sdk/JSONBodyParser.sol'; contract Index is Server { using JSONBodyParser for Request; // ... function myRoute ( Request calldata request ) public { address userAddress = request.json().at('user').at('address').asAddress(); string memory ens = request.json().at('user').at('ens').asString(); address[] memory tokens = request.json().at('tokens').asAddressArray(); // ... }
}

25.body:
Let's assume we want to write the following JSON to the response body: { "user": { "address": "0x61880628e88b391C0161225887D65087EF5bD19B", "ens": "dog.eth" }, "tokens": [ "0xA0b86991c6218b36c1d19D4a2e9Eb0cE3606eB48", "0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2" ]
} We would do it like so: import 'forgery-sdk/JSONBodyWriter.sol'; contract Index is Server { using JSONBodyWriter for Response; // ... function myRoute ( Request calldata request ) public { // ... address[] memory tokens = new address[](2); tokens[0] = 0xA0b86991c6218b36c1d19D4a2e9Eb0cE3606eB48; tokens[1] = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2; response.write('tokens', tokens); string memory userObject = vm.serializeAddress('user object', 'address', 0x61880628e88b391C0161225887D65087EF5bD19B); userObject = vm.serializeString('user object', 'ens', 'dog.eth'); response.write('user', userObject); }
}
